export function pick(obj, keys) {
    const ret = {};
    if (obj && typeof obj === 'object')
        for (const key of keys) {
            ret[key] = obj[key];
        }
    return ret;
}
export function omit(obj, keys) {
    const ret = {};
    if (obj && typeof obj === 'object') {
        for (const key in obj) {
            if (!keys.includes(key))
                ret[key] = obj[key];
        }
    }
    return ret;
}
